presets.css:
:root:root {
--cyan-accent-color: colorway(accent);
--cyan-background-primary: hsl(colorway(primary-h) calc(var(--saturation-factor, 1)*colorway(primary-s)%) colorway(primary-l)%/60%);
--cyan-second-layer: hsl(colorway(tertiary-h) calc(var(--saturation-factor, 1)*colorway(tertiary-s)%) min(colorway(tertiary-l)% + 7.2%, 100%)/60%);
}

:root:root {
--VBaccent: colorway(accent-h) calc(var(--saturation-factor, 1)*colorway(accent-s)%) colorway(accent-l)%;
--VBaccent-muted: colorway(tertiary-h) calc(var(--saturation-factor, 1)*colorway(tertiary-s)%) max(colorway(tertiary-l)% - 10%, 0%);
--VBaccent-dimmest: colorway(tertiary-h) calc(var(--saturation-factor, 1)*colorway(tertiary-s)%) min(colorway(tertiary-l)% + 15%, 100%);
}

.theme-light {
--neobrutal-color-1: hsl(colorway(primary-h) calc(var(--saturation-factor, 1)*colorway(primary-s)%) colorway(primary-l)%) !important;
--neobrutal-color-2: hsl(colorway(primary-h) calc(var(--saturation-factor, 1)*colorway(primary-s)%) min(colorway(primary-l)% + 80%, 90%)) !important;
--neobrutal-color-text: hsl(colorway(accent-h) colorway(accent-s)% calc(colorway(accent-l)% - 10%)) !important;
--neobrutal-color-accent: colorway(accent) !important;
}
.theme-dark {
--neobrutal-color-1: hsl(colorway(primary-h) calc(var(--saturation-factor, 1)*colorway(primary-s)%) min(colorway(primary-l)% + 80%, 90%)) !important;
--neobrutal-color-2: hsl(colorway(primary-h) calc(var(--saturation-factor, 1)*colorway(primary-s)%) colorway(primary-l)%) !important;
--neobrutal-color-text: hsl(colorway(accent-h) colorway(accent-s)% calc(colorway(accent-l)% - 10%)) !important;
--neobrutal-color-accent: colorway(accent) !important;
}

:root:root {
--accent-hue: colorway(accent-h);
--accent-saturation: calc(var(--saturation-factor, 1)colorway(accent-s)%);
--accent-brightness: colorway(accent-l)%;
--background-accent-hue: colorway(primary-h);
--background-accent-saturation: calc(var(--saturation-factor, 1)colorway(primary-s)%);
--background-accent-brightness: colorway(primary-l)%;
--background-overlay-opacity: 0%;
}

